let count;

function MyButton({ count, setCount }) {}

export default function MyApp() {
  const [count, setCount] = useState(0);

  const onClick = function () {
    setCount(count + 1);
  };

  return (
    <div>
      <h1>Header</h1>
      <MyButton count={count} onClick={onClick} />
      <MyButton count={count} onClick={onClick} />
    </div>
  );
